                driver_school_theory: "\u0410\u0412\u0422\u041E\u0428\u041A\u041E\u041B\u0410 | \u0422\u0415\u041E\u0420\u0418\u042F",
                traffic_speed: "\u0421\u043A\u043E\u0440\u043E\u0441\u0442\u044C \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F",
                traffic_speed_rule_1: "1) \u041C\u0430\u043A\u0441\u0438\u043C\u0430\u043B\u044C\u043D\u043E \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043D\u043D\u0430\u044F \u0441\u043A\u043E\u0440\u043E\u0441\u0442\u044C \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F \u0432 \u0433\u043E\u0440\u043E\u0434\u0435 - 60 \u043A\u043C/\u0447.",
