                perk_biker_flare_name: "\u0414\u043E\u0441\u0442\u0443\u043F \u043A \u043F\u043E\u043A\u0443\u043F\u043A\u0435 \u0444\u0430\u043B\u044C\u0448\u0444\u0435\u0439\u0435\u0440\u043E\u0432",
                perk_biker_flare_desc: "\u0423 \u0431\u0430\u0440\u043C\u0435\u043D\u0430 \u0432 \u043A\u043B\u0443\u0431\u0435 \u043C\u043E\u0436\u043D\u043E \u043F\u0440\u0438\u043E\u0431\u0440\u0435\u0441\u0442\u0438 \u0444\u0430\u043B\u044C\u0448\u0444\u0435\u0439\u0435\u0440\u044B, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u044F\u0440\u043A\u043E \u0433\u043E\u0440\u044F\u0442 \u043A\u0440\u0430\u0441\u043D\u044B\u043C \u043E\u0433\u043D\u0435\u043C \u0438 \u0438\u0441\u043F\u0443\u0441\u043A\u0430\u044E\u0442\u0441\u044F \u043A\u0440\u0430\u0441\u043D\u044B\u0439 \u0434\u044B\u043C \u0434\u043B\u044F \u043F\u0440\u0438\u0432\u043B\u0435\u0447\u0435\u043D\u0438\u044F \u0432\u043D\u0438\u043C\u0430\u043D\u0438\u044F.",
