                perk_biker_knuckle_name: "\u0414\u043E\u0441\u0442\u0443\u043F \u043A \u043F\u043E\u043A\u0443\u043F\u043A\u0435 \u043A\u0430\u0441\u0442\u0435\u0442\u043E\u0432",
