                help_all_chats_4: "Shift+T(F6) - \u043E\u0442\u043A\u0440\u044B\u0432\u0430\u0435\u0442 \u0447\u0430\u0442 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 (/r /f /d), \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u044F \u043C\u043E\u0436\u043D\u043E \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C [Tab].",
                shop_vip_faster_30_per: "\u041D\u0430 30% \u0431\u044B\u0441\u0442\u0440\u0435\u0435",
