                setting_tab_special: "\u0421\u041F\u0415\u0426.\u0412\u041E\u0417\u041C\u041E\u0416\u041D\u041E\u0421\u0422\u0418",
                help_rp_header: "RP \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0438",
                help_rp_1: "\u0414\u043B\u044F \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0438 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0438\u043B\u0438 \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u0439 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0435\u0439 \u0438\u043B\u0438 \u043E\u0431\u044A\u0435\u043A\u0442\u043E\u0432, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043D\u0435 \u043F\u0440\u0435\u0434\u0443\u0441\u043C\u043E\u0442\u0440\u0435\u043D\u044B \u0438\u0433\u0440\u043E\u0432\u043E\u0439 \u043C\u0435\u0445\u0430\u043D\u0438\u043A\u043E\u0439, \u043D\u0430 \u0441\u0435\u0440\u0432\u0435\u0440\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044E\u0442 \u043A\u043E\u043C\u0430\u043D\u0434\u044B.",
                help_rp_2: "/me - \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u043E\u0442 \u043F\u0435\u0440\u0432\u043E\u0433\u043E \u043B\u0438\u0446\u0430, \u043F\u0438\u0448\u0435\u0442\u0441\u044F \u0441 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u043E\u0439 \u0431\u0443\u043A\u0432\u044B \u0438 \u0431\u0435\u0437 \u0442\u043E\u0447\u043A\u0438 \u0432 \u043A\u043E\u043D\u0446\u0435.",
                help_rp_3: "\u041F\u0440\u0438\u043C\u0435\u0440: /me \u0432\u0441\u0442\u0430\u043B \u0441\u043E \u0441\u0442\u0443\u043B\u0430",
                help_rp_4: "/do - \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0430 \u043E\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u044F \u043E\u0431\u044A\u0435\u043A\u0442\u0430 \u0438\u043B\u0438 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0430, \u043F\u0438\u0448\u0435\u0442\u0441\u044F \u0441 \u0431\u043E\u043B\u044C\u0448\u043E\u0439 \u0431\u0443\u043A\u0432\u044B \u0438 \u0441 \u0442\u043E\u0447\u043A\u043E\u0439 \u0432 \u043A\u043E\u043D\u0446\u0435. \u0414\u0430\u043D\u043D\u0430\u044F \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0430 \u043D\u0435 \u043C\u043E\u0436\u0435\u0442 \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0442\u044C \u0432 \u0441\u0435\u0431\u0435 \u043B\u043E\u0436\u044C \u0438\u043B\u0438 \u043A\u043E\u043D\u0441\u0442\u0430\u0442\u0430\u0446\u0438\u044E \u0444\u0430\u043A\u0442\u0430 \u043E \u0434\u0440\u0443\u0433\u043E\u043C \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0435 (\u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0443 \u0441\u043C\u0435\u0440\u0442\u0438 \u0434\u0440\u0443\u0433\u043E\u0433\u043E \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0430).",
                help_rp_5: "\u041F\u0440\u0438\u043C\u0435\u0440: /do \u0414\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B \u043D\u0430\u0445\u043E\u0434\u044F\u0442\u0441\u044F \u0432 \u043F\u0440\u0430\u0432\u043E\u043C \u043A\u0430\u0440\u043C\u0430\u043D\u0435 \u0431\u0440\u044E\u043A.",
                help_rp_6: "/todo - \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0430 \u0440\u0435\u043F\u043B\u0438\u043A\u0438 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0430 \u043F\u0440\u0438 \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u0438\u0438 \u043A\u0430\u043A\u043E\u0433\u043E-\u0442\u043E \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F. \u042D\u0442\u043E \u0434\u0432\u043E\u0439\u043D\u0430\u044F \u043E\u0442\u044B\u0433\u0440\u043E\u0432\u043A\u0430, \u043F\u043E\u044D\u0442\u043E\u043C\u0443 \u043F\u0438\u0448\u0435\u0442\u0441\u044F \u0432 2 \u043E\u0442\u0434\u0435\u043B\u044C\u043D\u044B\u0445 \u0440\u0435\u043F\u043B\u0438\u043A\u0438, \u0440\u0430\u0437\u0434\u0435\u043B\u0435\u043D\u043D\u044B\u0445 \u0441\u0438\u043C\u0432\u043E\u043B\u043E\u043C * (\u0437\u0432\u0435\u0437\u0434\u043E\u0447\u043A\u0430). \u041F\u0435\u0440\u0432\u0430\u044F \u0447\u0430\u0441\u0442\u044C \u043F\u0438\u0448\u0435\u0442\u0441\u044F \u0441 \u0431\u043E\u043B\u044C\u0448\u043E\u0439 \u0431\u0443\u043A\u0432\u044B, \u0432\u0442\u043E\u0440\u0430\u044F \u0441 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u043E\u0439, \u043E\u0431\u0435 \u0431\u0435\u0437 \u0442\u043E\u0447\u043A\u0438.",
