                help_jobs_fishing_2: "\u0414\u043B\u044F \u0442\u043E\u0433\u043E \u0447\u0442\u043E\u0431\u044B \u043D\u0430\u0447\u0430\u0442\u044C \u0440\u044B\u0431\u0430\u0447\u0438\u0442\u044C \u0412\u0430\u043C \u043D\u0443\u0436\u043D\u043E \u043E\u0442\u043F\u0440\u0430\u0432\u0438\u0442\u044C\u0441\u044F \u0432 \u0440\u044B\u0431\u043E\u043B\u043E\u0432\u043D\u044B\u0439 \u043C\u0430\u0433\u0430\u0437\u0438\u043D \u0438 \u043F\u0440\u0438\u043E\u0431\u0440\u0435\u0441\u0442\u0438 \u0442\u0430\u043C \u043D\u0443\u0436\u043D\u044B\u0435 \u0441\u043D\u0430\u0441\u0442\u0438. \u0420\u044B\u0431\u0443 \u043C\u043E\u0436\u043D\u043E \u043B\u043E\u0432\u0438\u0442\u044C \u043A\u0430\u043A \u043D\u0430 \u043F\u0440\u0438\u043C\u0430\u043D\u043A\u0443, \u0442\u0430\u043A \u0438 \u043D\u0430 \u0447\u0435\u0440\u0432\u0435\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u043C\u043E\u0436\u043D\u043E \u0432\u044B\u043A\u043E\u043F\u0430\u0442\u044C \u043D\u0430 \u0431\u043B\u0438\u0436\u0430\u0439\u0448\u0435\u0439 \u0444\u0435\u0440\u043C\u0435 \u0441 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043B\u043E\u043F\u0430\u0442\u044B, \u043A\u043E\u0442\u043E\u0440\u0443\u044E \u0442\u0430\u043A\u0436\u0435 \u043C\u043E\u0436\u043D\u043E \u043A\u0443\u043F\u0438\u0442\u044C \u0443 \u043F\u0440\u043E\u0434\u0430\u0432\u0446\u0430 \u0440\u044B\u0431\u043E\u043B\u043E\u0432\u043D\u044B\u0445 \u0441\u043D\u0430\u0441\u0442\u0435\u0439.",
