                help_jobs_fishing_4: "\u0411\u0443\u0434\u044C\u0442\u0435 \u0431\u0434\u0438\u0442\u0435\u043B\u044C\u043D\u044B, \u0432\u0435\u0434\u044C \u0435\u0441\u043B\u0438 \u0412\u044B \u0431\u0443\u0434\u0435\u0442\u0435 \u0440\u044B\u0431\u0430\u0447\u0438\u0442\u044C \u0432 \u043E\u0442\u043A\u0440\u044B\u0442\u043E\u043C \u043C\u043E\u0440\u0435 \u0431\u0435\u0437 \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u0438, \u0412\u0430\u043C \u043C\u043E\u0433\u0443\u0442 \u0432\u044B\u043F\u0438\u0441\u0430\u0442\u044C \u0448\u0442\u0440\u0430\u0444, \u043B\u0438\u0431\u043E \u0436\u0435 \u0432\u043E\u0432\u0441\u0435 \u0430\u0440\u0435\u0441\u0442\u043E\u0432\u0430\u0442\u044C \u0437\u0430 \u0431\u0440\u0430\u043A\u043E\u043D\u044C\u0435\u0440\u0441\u0442\u0432\u043E.",
