                help_jobs_fishing_6: "\u041F\u043E\u043C\u0438\u043C\u043E \u044D\u0442\u043E\u0433\u043E, \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u0440\u044B\u0431\u0430\u043B\u043A\u0438 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0435\u0442 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u0439 \u043D\u0430\u0432\u044B\u043A, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0432\u043B\u0438\u044F\u0435\u0442 \u043D\u0430 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u043E \u043F\u043E\u0439\u043C\u0430\u043D\u043D\u043E\u0439 \u0440\u044B\u0431\u044B.",
                help_jobs_fishing_button_1: "\u041C\u0430\u0433\u0430\u0437\u0438\u043D",
