                help_faction_family_header: "\u041D\u0435\u043E\u0444\u0438\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438",
                help_faction_family_button: "\u0421\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438",
                help_faction_family_1: "\u041B\u044E\u0431\u043E\u0439 \u0438\u0433\u0440\u043E\u043A \u043C\u043E\u0436\u0435\u0442 \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u0441\u0432\u043E\u044E \u043D\u0435\u043E\u0444\u0438\u0446\u0438\u0430\u043B\u044C\u043D\u0443\u044E \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u044E, \u0447\u0442\u043E\u0431\u044B \u0440\u0435\u0430\u043B\u0438\u0437\u043E\u0432\u0430\u0442\u044C \u0441\u0432\u043E\u0438 \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0437\u0430\u0434\u0443\u043C\u043A\u0438, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043D\u0435 \u043F\u0440\u0435\u0434\u0443\u0441\u043C\u043E\u0442\u0440\u0435\u043D\u044B \u0444\u0440\u0430\u043A\u0446\u0438\u044F\u043C\u0438.",
                help_jobs_taxi_header: "\u0422\u0430\u043A\u0441\u0438",
                help_jobs_taxi_1: "\u041F\u043E\u043B\u0443\u0447\u0438\u0432 \u0432\u043E\u0434\u0438\u0442\u0435\u043B\u044C\u0441\u043A\u0438\u0435 \u043F\u0440\u0430\u0432\u0430 \u0432 \u0430\u0432\u0442\u043E\u0448\u043A\u043E\u043B\u0435, \u0412\u044B \u043C\u043E\u0436\u0435\u0442\u0435 \u043D\u0430\u0447\u0430\u0442\u044C \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u0442\u0430\u043A\u0441\u0438\u0441\u0442\u043E\u043C (\u0430\u0440\u0435\u043D\u0434\u0430 \u043C\u0430\u0448\u0438\u043D\u044B \u0441\u0442\u043E\u0438\u0442 \u0434\u0435\u043D\u0435\u0433, \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u043E \u0441\u043E 2 \u0443\u0440\u043E\u0432\u043D\u044F).",
                help_faction_family_2: "\u041D\u0435\u043E\u0444\u0438\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u043C\u043E\u0433\u0443\u0442 \u0437\u0430\u043F\u0440\u043E\u0441\u0438\u0442\u044C \u043D\u0435\u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0444\u0443\u043D\u043A\u0446\u0438\u043E\u043D\u0430\u043B \u0443 \u0430\u0434\u043C\u0438\u043D\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438, \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u0441\u0442\u044F\u0436\u043A\u0438 \u0438 \u043A\u043E\u043D\u0432\u043E\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435, \u043F\u0443\u0442\u0435\u043C \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u0441\u043A\u0440\u0438\u043D\u0448\u043E\u0442-\u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u043D\u0430 \u0444\u043E\u0440\u0443\u043C\u0435 \u043F\u0440\u043E\u0435\u043A\u0442\u0430.",
                help_faction_family_3: "\u041E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u043C\u043E\u0433\u0443\u0442 \u043F\u0440\u0438\u043E\u0431\u0440\u0435\u0442\u0430\u0442\u044C \u0432 \u0441\u0432\u043E\u044E \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0441\u0442\u044C \u043E\u0444\u0438\u0441, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0442\u043A\u0440\u043E\u0435\u0442 \u0438\u043C \u0434\u043E\u0441\u0442\u0443\u043F \u043A \u0437\u0430\u0440\u0430\u0431\u043E\u0442\u043A\u0443 \u043D\u0430 \u043A\u043E\u043D\u0442\u0440\u0430\u043A\u0442\u0430\u0445 \u0438 \u0441\u043A\u043B\u0430\u0434\u0443, \u0438 \u043E\u0441\u043E\u0431\u043D\u044F\u043A, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043F\u043E\u0437\u0432\u043E\u043B\u0438\u0442 \u043F\u043E\u043A\u0443\u043F\u0430\u0442\u044C \u0432 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0441\u0442\u044C \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0438\u043B\u0438, \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0435 \u0432\u0441\u0435\u043C \u0435\u0451 \u0447\u043B\u0435\u043D\u0430\u043C.",
                help_jobs_taxi_2: "\u041F\u043E\u0441\u043B\u0435 \u043D\u0430\u0447\u0430\u043B\u0430 \u0440\u0430\u0431\u043E\u0447\u0435\u0433\u043E \u0434\u043D\u044F, \u0412\u0430\u043C \u0441\u0442\u0430\u043D\u0435\u0442 \u0434\u043E\u0441\u0442\u0443\u043F\u0435\u043D \u041A\u041F\u041A \u0441\u043E \u0441\u043F\u0438\u0441\u043A\u043E\u043C \u0432\u044B\u0437\u043E\u0432\u043E\u0432 (M > \u041A\u041F\u041A).",
                help_faction_family_4: "\u0421\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u043D\u0435\u043E\u0444\u0438\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u0442\u043E\u0438\u0442 800.000$ \u0438\u043B\u0438 2000 DP \u0438 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u043E \u0443 NPC \u0432 \u041C\u044D\u0440\u0438\u0438 \u041B\u0421.",
                help_jobs_taxi_3: "\u041F\u043E\u0441\u043B\u0435 \u0442\u043E\u0433\u043E, \u043A\u0430\u043A \u043A\u043B\u0438\u0435\u043D\u0442 \u0441\u044F\u0434\u0435\u0442 \u043A \u0412\u0430\u043C \u0432 \u043C\u0430\u0448\u0438\u043D\u0443, \u0443 \u043D\u0435\u0433\u043E \u043F\u043E\u044F\u0432\u0438\u0442\u0441\u044F \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u043F\u0435\u0440\u0435\u0434\u0430\u0442\u044C \u0412\u0430\u043C \u043A\u043E\u043E\u0440\u0434\u0438\u043D\u0430\u0442\u044B \u0434\u043B\u044F \u043F\u043E\u0435\u0437\u0434\u043A\u0438. \u041F\u043E\u0441\u043B\u0435 \u044D\u0442\u043E\u0433\u043E \u0412\u044B \u0441\u043C\u043E\u0436\u0435\u0442\u0435 \u0443\u043A\u0430\u0437\u0430\u0442\u044C \u0441\u0443\u043C\u043C\u0443 \u0438 \u043E\u0442\u043F\u0440\u0430\u0432\u0438\u0442\u044C \u0435\u043C\u0443 \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0435\u043D\u0438\u0435.",
                help_jobs_taxi_button_1: "\u0422\u0430\u043A\u0441\u043E\u043F\u0430\u0440\u043A 1",
                help_jobs_taxi_button_2: "\u0422\u0430\u043A\u0441\u043E\u043F\u0430\u0440\u043A 2",
                help_faction_news_header: "Weazel News",
                help_jobs_taxi_button_3: "\u0422\u0430\u043A\u0441\u043E\u043F\u0430\u0440\u043A 3",
                help_faction_news_1: "Weazel News - \u043D\u043E\u0432\u043E\u0441\u0442\u043D\u043E\u0435 \u0430\u0433\u0435\u043D\u0442\u0441\u0442\u0432\u043E \u0448\u0442\u0430\u0442\u0430.",
