                help_jobs_mechanic_3: "\u0412\u0441\u0435 \u0447\u0442\u043E \u0412\u0430\u043C \u043D\u0443\u0436\u043D\u043E, \u044D\u0442\u043E \u043F\u0440\u0438\u0435\u0445\u0430\u0442\u044C \u043D\u0430 \u043F\u0440\u0438\u043D\u044F\u0442\u044B\u0439 \u0432\u044B\u0437\u043E\u0432 \u0438 \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0438\u0442\u044C \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0439 \u0412\u0430\u043C \u0432\u0438\u0434 \u0443\u0441\u043B\u0443\u0433 \u0447\u0435\u0440\u0435\u0437 \u043C\u0435\u043D\u044E \u0432\u0437\u0430\u0438\u043C\u043E\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u043D\u0430 \u043A\u043D\u043E\u043F\u043A\u0443 G > \u0420\u0430\u0431\u043E\u0442\u0430, \u0430 \u0438\u043C\u0435\u043D\u043D\u043E: \u0417\u0430\u043F\u0440\u0430\u0432\u0438\u0442\u044C, \u041F\u043E\u0447\u0438\u043D\u0438\u0442\u044C, \u0411\u0443\u043A\u0441\u0438\u0440\u043E\u0432\u0430\u0442\u044C \u0438\u043B\u0438 \u041F\u0435\u0440\u0435\u0432\u0435\u0440\u043D\u0443\u0442\u044C \u0430\u0432\u0442\u043E.",
